import axios from 'axios'
import { apikey, ts, hash } from './helper'

const Marvel = () => {
	const [hero, setHero] = useState({})

	useEffect(() => {
		axios(`https://gateway.marvel.com:443/v1/public/characters?apikey=${apikey}&ts=${ts}&hash=${hash}&name=hulk`)
		.then(response => setHero(response.data.data.results[0]))
		.catch(err => console.log(err))
	}, [])

	return(
		<h1>Kopet</h1>
	)
}

export default Marvel
